import React from "react"

function KupovinaKarteForm(props){
    return(
        <form>
            <p>Film: {props.projekcija.film}</p>
            <p>Vreme prikazivanje: {props.projekcija.datumVremePrikazivanja}</p>
            <p>Tip projekcije: {props.projekcija.tipProjekcije}</p>
            <button type="submit">Kupi kartu</button>
        </form>
    )
}

export default KupovinaKarteForm
